 		<div data-v-74deda16 class=subheading>WTD also providing the partner programs which will provides you the way forward simply you can enhance your profit by aligning your products and purchases with WTD. Dealer can </div></h4><h4 data-v-74deda16><div data-v-74deda16 class=heading>Base Incentive</div> <div data-v-74deda16 class=subheading>Eligible dealers earn Partner Program Base Incentive rewards on select products as long as their passenger and light truck purchase volume is greater than previous year or a minimum of $50,000 annually, whichever is greater.</div></h4><h4 data-v-74deda16><div data-v-74deda16 class=heading>Compliance Incentive</div> <div data-v-74deda16 class=subheading>Affilliated Passenger and Light Truck Associate Program dealers earn Partner Program Compliance Incentive rewards as long as YTD minimum program unit volume and YTD Base Incentive dollar volume objectives are achieved.</div></h4></div></div> <div data-v-74deda16 class=image-container><div data-v-74deda16 class="image plus" style="background-image:url(images/1.png)"></div></div></div></div></div> 

